// Footer.js
import React from 'react';
import '../css/Footer.css'; // Import the CSS file for styling

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-content">
        <div className="gray-box"></div>
      </div>
    </footer>
  );
};

export default Footer;
